import React from 'react';
import { useNavigate } from 'react-router-dom';
import './FrontPage.css';

function FrontPage() {
  const navigate = useNavigate();

  return (
    <div className="front-page">
      {/* Logo in Top-Left Corner */}
      <img
        src="/p1.jpg"
        alt="CSECU Logo"
        className="logo"
        onClick={() => navigate('/')} // Optional: Navigate to home or other route on click
      />

       {/* University Logo in Top-Left Corner */}
      <img
        src="/university-logo.png" // Replace with actual university logo path
        alt="University Logo"
        className="university-logo"
        onClick={() => navigate('/')}
      />

      {/* About & Contact Links in Top-Right Corner */}
      <div className="nav-links">
        <a href="/about">About</a>
        <a href="/contact">Contact</a>
      </div>


      {/* Hero Section */}
      <section className="hero">
        <h1 className="hero-title">Welcome to CSECU</h1>
        <p className="hero-subtitle">Join us in revolutionizing Computer Science and Engineering</p>
      </section>

      {/* Buttons in Top-Right Corner */}
      <div className="button-group">
        <button className="btn primary" onClick={() => navigate('/signup')}>
          Get Started
        </button>
        <button className="btn secondary" onClick={() => navigate('/login')}>
          Get Quotes
        </button>
      </div>
    </div>
  );
}

export default FrontPage;
